import React from 'react'

const ElementoMenu = (datos) => {
  return (
    <li key={datos.indexkey}>
      <input type='checkbox' value={datos.idMenu}>
          {datos.nombreMenu}   {datos.tipoMenu}  {datos.precio}
      </input>
    </li>
  )
}

export default ElementoMenu
